import React from "react";
import { Header } from "./homepage";
import { useNavigate } from "react-router";


function Main(props){
    let lgt=useNavigate();


function Logout(){ 

    localStorage.removeItem('auth');
    localStorage.removeItem('token');
    lgt('/');

 }

 
 
    return(
        <div>
    
         
         <Header login='Logout'  sidebar='mySidebar' home='Home' loginfont='fa fa-usd' navi={Logout}  />
         <div></div>
         <div class="w3-top">
  <div className="w3-bar w3-white w3-card" id="myNavbar">
    <a href="#home" className="w3-bar-item w3-button w3-wide">VOTE</a>
    <div class="w3-right w3-hide-small">
      <a onClick={props.h} class="w3-bar-item w3-button">{props.home}</a>
      <a href="#team" class="w3-bar-item w3-button"><i class={props.teamfont}></i> {props.team}</a>
      <a href="#work" class="w3-bar-item w3-button"><i class={props.workfont}></i> {props.work}</a>
      <a class="w3-bar-item w3-button"><i class={props.contactfont}></i>{props.contact} </a>
      <a  onClick={props.navi}  class="w3-bar-item w3-button"><i class={props.loginfont}></i> {props.login}</a>
    </div>

    <a href="javascript:void(0)" class="w3-bar-item w3-button w3-right w3-hide-large w3-hide-medium"  onClick={toggle}>
      <i class="fa fa-bars"></i>
    </a>
  </div>
</div>


<nav className="w3-sidebar w3-bar-block w3-black w3-card w3-animate-left w3-hide-medium w3-hide-large"  id={props.sidebar} >
  <a href="javascript:void(0)" onClick={closetoggle}  class="w3-bar-item w3-button w3-large w3-padding-16">Close Ã—</a>
  <a href="#about"  class="w3-bar-item w3-button">{props.home}</a>
  <a href="#team"   class="w3-bar-item w3-button">{props.team}</a>
  <a href="#work"  class="w3-bar-item w3-button">{props.work}</a>
  <a  onClick={props.navi}  class="w3-bar-item w3-button">{props.login}</a>
  <a href="#contact"  class="w3-bar-item w3-button">{props.contact}</a>
</nav>

        </div>
    );
}

export default Main;
